def find_score_distribution(n, m):

    def limit(n):
        if n < 3:
            return 0
        if n ^ 1:
            return (n - 1) * (n - 1) >> 2
        else:
            return (n - 2) * n >> 2
    if m >= limit(n):
        return -1
    elif not m:
        ans = [10 ** 8 + 1]
        while len(ans) < n:
            ans.append(ans[-1] + 10 ** 4)
        return ans
    L = 3
    R = n + 1
    while L + 1 < R:
        k = L + R >> 1
        if limit(k) > m:
            R = k
        else:
            L = k
    k = L
    ans = list(range(1, k + 1))
    req = m - limit(k)
    if req > 0:
        ans.append(ans[-1] + ans[-2 * req])
        k += 1
    big_num = 10 ** 8 + 1
    for i in range(k, n):
        ans.append(big_num)
        big_num += 10 ** 4
    return ans

